import MainMenu from "./mainMenu";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

const App = () => {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<MainMenu />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
